description:
While there are already countless math libraries for performing common matrix/array functions, StarMath is distinguished by its simplicity and flexbility. There is no need to declare vectors and matrices in a specific library format. It works simliar to Math.function calls in C#. 
The library is small and fully compiles to a Portable Class Library (for all platforms). StarMath (version > 2.0) takes advantage of  'extensions', which allows for concise representations of many functions. Now you can write either:
 StarMath.multiply(A, x);
 or
 A.multiply(x);

summary:
A tiny host that runs backend web services and fakes their responses for your app test

example:

[SetUp]
public void SetUp()
{
    _tinyFakeHost = new TinyFakeHost("http://localhost:5432/someService/v1/");
    _faker = _tinyFakeHost.GetFaker();
    _tinyFakeHost.Start();
}

[Test]
public void Your_Test_Method()
{
    // your test code . . . .

    _faker.Fake(f => f
        .IfRequest("/vendors/9876-5432-1098-7654/products")
        .WithParameters("type=desk&manufactureYear=2013")
        .ThenReturn(products)
    );

    _faker.Fake(f => f
        .IfRequest("/vendors")
        .ThenReturn(vendors)
    );

    // your test code . . . .
}

[TearDown]
public void TearDown()
{
    _tinyFakeHost.Stop();
    _tinyFakeHost.Dispose();
}

